description:
DareDorm - Celebration.avi

Cinco De Mayo, outside of being a celebration of Mexican pride, is a great excuse to get wasted and do shit you otherwise wouldnt do. Its a great scapegoat for all the nasty things you do on the holiday. Oh shit, I did that, I dont even remember...it was Cinco De Mayo, dude. Chalk it up to that. I have reason to believe that these crazy college kids felt the same way when they recorded themselves in full blown orgy mode. To celebrate Cinco De Mayo, the boys and girls involved got themselves decked out in traditional Mexican regalia colorful sombreros and ponchos.

